import React, { Fragment, useState } from 'react'
import PropTypes from 'prop-types'
import { connect } from 'react-redux'
import { Form, FormControl, FormGroup, FormLabel } from 'react-bootstrap'

const PickStonks = props => {
  const [formData, setFormData] = useState({
    stonks: ''
  })
  // destructure by pulling from form data
  const {
    stonks
  } = formData

  return (
    <Fragment>
      <h1>Here is where you add stonks to your list</h1>
      <Form>
        <FormGroup controlId='stonksChosen'>
          <FormLabel>Stonks in our Database</FormLabel>
          {/* <FormControl as='select'>
            <option> TSLA </option>
            <option> AAL </option>
            <option> GE </option>
            <option>  WFC </option>
            <option> GME </option>
          </FormControl> */}

          <div key={`disabled`} className='mb-3'>
            <Form.Check
              value={`tsla`}
              label={`TSLA`}
            />
            <Form.Check
              id={`aal`}
              label={`AAL`}
            />
            <Form.Check
              id={`gme`}
              label={`GME`}
            />
            <Form.Check
              id={`wfc`}
              label={`WFC`}
            />
            <Form.Check
              id={`spy`}
              label={`SPY`}
            />
          </div>

        </FormGroup>

      </Form>
    </Fragment>
  )
}

PickStonks.propTypes = {

}

export default PickStonks
